import Expenseitem from "./components/Expenseitem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "car ensurance",
      amount: 5400,
      date: new Date(2021, 2, 28),
    },
    { id: "e2", title: "elecrisity", amount: 200, date: new Date(2021, 8, 2) },
    { id: "e3", title: "internet", amount: 150, date: new Date(2021, 6, 5) },
    { id: "e4", title: "food", amount: 200, date: new Date(2021, 2, 8) },
  ];

  return (
    <div>
      <h2>Let's get started Helloooo!</h2>
      <Expenseitem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></Expenseitem>
      <Expenseitem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></Expenseitem>
      <Expenseitem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></Expenseitem>

    </div>
  );
}

export default App;
